import React from 'react'
import { useParams } from 'react-router-dom'
function Categore() {
    console.log("Aaa");
    const  {categore}  = useParams()
    console.log(categore)
    return (
        <>
            <h1 className='mt-5'>{categore}</h1>
            <h1>aaa</h1>
            <h1>dfgb</h1>
        </>
    )
}

export default Categore
